export function editIntro(data)
{
    console.log(data);
    return dispatch =>{
        return fetch(`http://localhost:8080/auth/signup`, {
            method: 'PUT',
            body: JSON.stringify(data), 
             headers:{
            'Content-Type': 'application/json'
                }
            }).then(response => response.json())
            .then((data) => {
                dispatch({type:'introupdated', payload:data})
            })
    }   
}
